import React from "react";
import styled from "styled-components";
import Footer from "../Footer";
import D20 from "../../Images/Dice/D20Icon";

const LoginBackground = () => {
  return <D20 button={true} width={40} />;
};

const Container = styled.div`
  background-color: #252525;
  width: 99vw;
  height: calc(100vh - 75px);
`;

const Background = styled.div`
  width: 99vw;
  height: 300px;
  margin-top: 10px;
  background-image: url(${D20});
`;

const Login = () => {
  return (
    <div>
      <Container>
        <div class="patterns">
          <svg width="100%" height="100%">
            <defs>
              <pattern
                id="polka-dots"
                x="0"
                y="0"
                width="100"
                height="100"
                patternUnits="userSpaceOnUse"
              >
                <circle fill="#bee9e8" cx="50" cy="50" r="25" />
              </pattern>
            </defs>

            <rect
              x="0"
              y="0"
              width="100%"
              height="100%"
              fill="url(#polka-dots)"
            />
          </svg>
        </div>
      </Container>
      <Footer />
    </div>
  );
};

export default Login;
